pragma solidity ^0.8.10;


contract Crypto {

    mapping(address => uint) _balance;

    fallback() payable external {
        _balance[msg.sender] += msg.value;
    }

    receive() payable external {
        _balance[msg.sender] += msg.value;
    }

    struct PropertyRegistry{   
        
        address payable OwnerAddress;
        uint Rooms;
        string Furnished;
        string RentOrSale;
        uint Area; 
        string City; 
        string State; 
        uint PropertyPrice; 
        uint PropertyPID;
        bool IsPropertyVerified;
    
    }

    struct BuyerDetails{
        
        address BuyerAddress;
        string Name;
        uint Age; 
        string City;  
        string Email;
        bool IsBuyerVerified;
        
    }
    
    struct SellerDetails{

        address SellerAddress;
        string Name;
        string Email; 
        uint Phone;
        // string CurrentAdd;
        string Password;
        string Aadhaar;
    
    }

    mapping(uint => PropertyRegistry) public PropertyMapping; 
    mapping(address => SellerDetails) public SellerMapping;
    mapping(address => BuyerDetails) public BuyerMapping; 


    event SellerRegistration(
        address _SellerRegistered,
        string Name, 
        string Email, 
        uint Phone,
        string Password,
        string Aadhaar);
    
    event BuyerRegistration(
        address _BuyerRegistered,
        string Name, 
        uint Age,
        string City,
        string Email);
    
    // event Verified(address _Id);
    
    // event Rejected(address _Id);

    /*

    /////////////////// Register Seller ///////////////
    /////// Seller will register with his details
    /////// PropertyInspector can either verify that seller or reject that seller
    /////// We can also update the seller details
    /////// We can check if seller is verified or not


    */   

    function parseAddr(string memory _a) internal pure returns (address _parsedAddress) {
    bytes memory tmp = bytes(_a);
    uint160 iaddr = 0;
    uint160 b1;
    uint160 b2;
    for (uint i = 2; i < 2 + 2 * 20; i += 2) {
        iaddr *= 256;
        b1 = uint160(uint8(tmp[i]));
        b2 = uint160(uint8(tmp[i + 1]));
        if ((b1 >= 97) && (b1 <= 102)) {
            b1 -= 87;
        } else if ((b1 >= 65) && (b1 <= 70)) {
            b1 -= 55;
        } else if ((b1 >= 48) && (b1 <= 57)) {
            b1 -= 48;
        }
        if ((b2 >= 97) && (b2 <= 102)) {
            b2 -= 87;
        } else if ((b2 >= 65) && (b2 <= 70)) {
            b2 -= 55;
        } else if ((b2 >= 48) && (b2 <= 57)) {
            b2 -= 48;
        }
        iaddr += (b1 * 16 + b2);
    }
    return address(iaddr);
} 


    function RegisterSeller(

        string memory SellerAddress,
        string memory Name, 
        string memory Email, 
        uint Phone,
        // string memory CurrentAdd,
        string memory Password,
        string memory Aadhaar)  
        external
    {
 
    

    address a= parseAddr(SellerAddress);
    require(a==msg.sender,
        "This address is already registered as another Seller or Buyer");

        SellerMapping[a]=SellerDetails(
        msg.sender,
        Name, 
        Email,
        Phone,
        // CurrentAdd,
        Password,
        Aadhaar);
     
    emit SellerRegistration(
        msg.sender,
        Name, 
        Email,
        Phone,
        // CurrentAdd,
        Password,
        Aadhaar);

    }

    function GetSellerDetails(address SellerAddress) 
        
        public view returns(
        string memory, 
        string memory, 
        uint,
        // string memory,
        string memory,
        string memory) 
    { 
        return(
        SellerMapping[SellerAddress].Name,
        SellerMapping[SellerAddress].Email,
        SellerMapping[SellerAddress].Phone,
        // SellerMapping[SellerAddress].CurrentAdd,
        SellerMapping[SellerAddress].Password,
        SellerMapping[SellerAddress].Aadhaar);
        
        
    }

   


    function UpdateSellerDetails(

        string memory SellerAddress, 
        string memory _Name, 
        string memory _Email, 
        uint _Phone, 
        // string memory _CurrentAdd, 
        string memory _Password, 
        string memory _Aadhaar) external 
    {

    address b= parseAddr(SellerAddress);
    require(b==msg.sender,
        "This address is already registered as another Seller or Buyer");
   
        SellerMapping[b].Name = _Name;
        SellerMapping[b].Email = _Email;
        SellerMapping[b].Phone = _Phone;
        // SellerMapping[b].CurrentAdd = _CurrentAdd;
        SellerMapping[b].Password = _Password;
        SellerMapping[b].Aadhaar = _Aadhaar;

    }

   
    /*

    /////////////////// Register Buyer ////////////////
    //////// we will register Buyer with Buyer details
    //////// If Buyer is registered then PropertyInpector either verify that Buyer 
    //////// or reject that buyer
    //////// We can also update the Buyer details 
    //////// We can check if Buyer is verified or not
    
    
    */  
    
   function RegisterBuyer(

        string memory BuyerAddress,
        string memory Name,
        uint Age,
        string memory City,
        string memory Email) 
        external 
    {
    
    address c= parseAddr(BuyerAddress);
    require(c==msg.sender,
        "This address is already registered");
    
        BuyerMapping[c]=BuyerDetails(
        msg.sender,
        Name,
        Age,
        City, 
        Email,
        false);

    emit BuyerRegistration(
        msg.sender,
        Name, 
        Age,
        City,
        Email);
        
    }

    function GetBuyerDetails(address BuyerAddress)
        
        external view returns(
        string memory, 
        uint,
        string memory,
        string memory) 
    { 
        return(
        BuyerMapping[BuyerAddress].Name,
        BuyerMapping[BuyerAddress].Age,
        BuyerMapping[BuyerAddress].City,
        BuyerMapping[BuyerAddress].Email);

    }

    function UpdateBuyerDetails(
        
        string memory BuyerAddress, 
        string memory _Name, 
        uint _Age, 
        string memory _City, 
        string memory _Email) 
        external 
    {
    
    address d= parseAddr(BuyerAddress);
    require(d==msg.sender,
        "This address is already registered as seller or buyer");

        BuyerMapping[d].Name = _Name;
        BuyerMapping[d].Age = _Age;
        BuyerMapping[d].City = _City;
        BuyerMapping[d].Email = _Email;

    }
   
    /*
     
    ///////////////////////// Add Property Details //////////////////
    /////// If seller is verified then seller upload Property details
    /////// if seller is not verified by PropertyInspector they cannot add the Property details.  
    /////// PropertyInspector will also verify the Property added by seller by PropertyID 
    /////// We can get Property details by PropertyID
    /////// We can check who is the owner of this Property by PropertyID 
    //////// We can check who is the current owner of this Property. 
    
    */
     
    function RegisterProperty(
        
        uint PropertyId,
        address payable OwnerAddress,
        uint Rooms,
        string memory Furnished,
        string memory RentOrSale,
        uint Area,
        string memory City,
        string memory State,
        uint PropertyPrice,
        uint PropertyPID) 
        external  
    {
 
    require(OwnerAddress==msg.sender,
        "Seller address must be the OwnerAddress");
    
   
        PropertyMapping[PropertyId]= PropertyRegistry( 
        OwnerAddress, 
        Rooms,
        Furnished,
        RentOrSale,
        Area, 
        City, 
        State, 
        PropertyPrice, 
        PropertyPID, 
        false);

    }

    function GetPropertyDetails(uint PropertyId) 
        
        internal view returns(
        address,
        uint,
        string memory, 
        string memory,
        uint,
        string memory, 
        string memory,
        uint,
        uint)
    {
        return(

        PropertyMapping[PropertyId].OwnerAddress,
        PropertyMapping[PropertyId].Rooms,
        PropertyMapping[PropertyId].Furnished,
        PropertyMapping[PropertyId].RentOrSale,
        PropertyMapping[PropertyId].Area,
        PropertyMapping[PropertyId].City,
        PropertyMapping[PropertyId].State,
        PropertyMapping[PropertyId].PropertyPrice,
        PropertyMapping[PropertyId].PropertyPID);
    
    }
   
    function GetPropertyCity(uint  _GetPropertyCity)
        public view returns(
        string memory)
    {
        return 
        PropertyMapping[_GetPropertyCity].City;

    }

    function GetPropertyPrice(uint  _GetPropertyPrice) 
        public view returns(uint)
    {
        return 
        PropertyMapping[_GetPropertyPrice].PropertyPrice;

    }

    function GetPropertyArea(uint  _GetPropertyArea)
        public view returns(uint)
    {
        return 
        PropertyMapping[_GetPropertyArea].Area;

    }

    function CurrentPropertyOwner(uint PropertyId)
        public view returns(
        address)
    {
        return 
        PropertyMapping[PropertyId].OwnerAddress;
    
    }

    /*

    ////////////////////////////////// Buy Property //////////////////////
    //////// Buyer can buy the Property only if buyer and Property both is verified
    //////// buyer need to give the  amount and Propertyid that they wants to buy 
    
    */

    function BuyProperty(
         
        uint PropertyId) 
        public payable returns(uint)
    {
    // require(PropertyMapping[PropertyId].IsPropertyVerified=true, 
    //     "Property is not verified by PropertyInspector");

    require(BuyerMapping[msg.sender].BuyerAddress == msg.sender,
        "Only buyer is allowed to buy Property");

    require(msg.value == PropertyMapping[PropertyId].PropertyPrice,
        " Not enough ether, it must be equal to PropertyPrice ");
    
        PropertyMapping[PropertyId].OwnerAddress.transfer(msg.value);
    return
    msg.value;
    }

    /*
    
    ////////////////////// TransferOwnership /////////////////////
    //////// Owenrship will change to current owner to newOnwer.
    //////// Owner of the Property can transfer their Property to any address if 
    //////// the is Property is verified by  PropertyInspector 

    */
    
    function TransferOwnerShip(
        
        uint PropertyId, 
        address payable NewOwnerAddress) 
        public 
    {
    
    require(PropertyMapping[PropertyId].IsPropertyVerified=true,
        "Property must be verified by Propertyinspector");
   
    require(PropertyMapping[PropertyId].OwnerAddress == msg.sender,
        "YOU ARE NOT THE OWNER OF THIS PROPERTY");
   
    require(PropertyMapping[PropertyId].OwnerAddress != NewOwnerAddress,
        "NewOwner address must be unique"); 
   
        PropertyMapping[PropertyId].OwnerAddress=NewOwnerAddress;
    }

    /*
    ////////////// Check buyer and seller account balance to 
    ////////////// confirm transaction
    */
    
    function ShowBalance(
        
        address _address) 
        external view returns(uint)
    {
        return address(_address).balance;
    }
